import React from 'react';
import {Outlet,Link} from 'react-router-dom';
import './men.css';

const Men = () => {
  return (
    <section id='mensection'> 
      <div id="wrapper">
    <div id="topmenu">
        <ul>
        <li> <Link to="men">Men</Link> 
              <li><Link to="tshirts">tshirts</Link> </li>
              <li><Link to="shirts">shirts</Link> </li>
             </li>
             </ul>
             </div>
             </div>


             <div id='menoutlet'>
             <Outlet/>
             </div>
    </section>



  )
}

export default Men
